import React, { Component } from 'react';
import styles from './resumeList.module.scss';

export default ({ experienceDate }) => {
    return <div>
            {
               experienceDate.map(item => 
                <ul className= { styles.card }>
                    <div className= { styles.left}>
                        <li key={item.id}> {item.time} </li>
                        <li>{item.role}</li>
                        <li>{item.company}</li>
                        <li>{item.location}</li>
                    </div>
                    <div className= { styles.right}>
                    <li>{item.desc}</li>
                    </div>
                </ul>)
            }
    </div>
}
